import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import * as TT from "../styles/StyledTimeTable";

const TimeTable = () => {
  const navigate = useNavigate();

  // 이미지 상태 관리
  const [isClicked1001, setIsClicked1001] = useState(true); // 처음에는 Clicked1001.svg로 설정
  const [isClicked1002, setIsClicked1002] = useState(false); // 처음에는 unClicked1002.svg로 설정

  // 날짜 상태 관리
  const [activeDate, setActiveDate] = useState("1001");

  // 이미지 클릭 핸들러
  const handleClick1001 = () => {
    setActiveDate("1001"); // 1001 클릭 시 해당 날짜를 active로 설정
    setIsClicked1001(true); // 1001 클릭 시 true
    setIsClicked1002(false); // 1002는 false로
  };

  const handleClick1002 = () => {
    setActiveDate("1002"); // 1002 클릭 시 해당 날짜를 active로 설정
    setIsClicked1001(false); // 1001은 false로
    setIsClicked1002(true); // 1002 클릭 시 true
  };

  const goback = () => {
    navigate(`/`);
  };

  // 부스 데이터
  const boothData = [
    {
      name: "<달 골짜기 타로 가게>",
      time: "15:00-19:00",
      info: "(사전 예약제)",
      type: "부스",
      date: "1001",
    },
    {
      name: "주점 부스 운영",
      time: "16:00-22:00",
      info: "(일부 주점 12시부터 운영)",
      type: "부스",
      date: "1001",
    },
    {
      name: "버스킹 <솜솜어게인>",
      time: "19:00-21:00",
      info: "",
      type: "공연",
      date: "1001",
    },
    {
      name: "ㅌㅅㅌ",
      time: "10:00-11:00",
      info: "불꽃놀이 공연",
      type: "부스",
      date: "1002",
    },
    {
      name: "맹구",
      time: "12:00-15:00",
      info: "콧물돌리기",
      type: "공연",
      date: "1002",
    },
    {
      name: "똥꼬쇼",
      time: "16:00-20:00",
      info: "불타는똥꼬쇼",
      type: "공연",
      date: "1002",
    },
    {
      name: "도망치는도련님",
      time: "20:00-22:00",
      info: "딱대~",
      type: "부스",
      date: "1002",
    },
  ];

  // 현재 선택된 날짜에 맞는 부스 필터링
  const filteredBooths = boothData.filter((booth) => booth.date === activeDate);

  return (
    <TT.Container>
      <TT.Header>
        <TT.Back>
          <img
            id="back"
            src={`${process.env.PUBLIC_URL}/images/Backbtn.svg`}
            alt="back"
            onClick={goback}
          />
        </TT.Back>
        <TT.Title>타임테이블</TT.Title>
      </TT.Header>
      <TT.Background>
        <object
          data={`${process.env.PUBLIC_URL}/images/TTBack.svg`}
          alt="background"
        />
      </TT.Background>
      <TT.Wrap>
        <TT.Date>
          <img
            id="1001"
            src={`${process.env.PUBLIC_URL}/images/${
              isClicked1001 ? "Clicked1001.svg" : "unClicked1001.svg"
            }`}
            alt="1001"
            onClick={handleClick1001}
            className={isClicked1001 ? "active" : ""}
          />
          <img
            id="1002"
            src={`${process.env.PUBLIC_URL}/images/${
              isClicked1002 ? "Clicked1002.svg" : "unClicked1002.svg"
            }`}
            alt="1002"
            onClick={handleClick1002}
            className={isClicked1002 ? "active" : ""}
          />
        </TT.Date>
        <TT.Table>
          <TT.Menu>
            <div id="title">부스</div>
            <div id="line1"></div>
          </TT.Menu>
          <TT.Center></TT.Center>
          <TT.Menu>
            <div id="title">공연</div>
            <div id="line2"></div>
          </TT.Menu>
          <TT.Boothlist>
            {filteredBooths.map((booth, index) => (
              <TT.Booth key={index} type={booth.type}>
                <div id="wrap">
                  <div id="top" type={booth.type}>
                    {booth.type === "부스" ? (
                      <>
                        <p id="time">{booth.time}</p>
                        <img
                          id="arrow"
                          type={booth.type}
                          src={`${process.env.PUBLIC_URL}/images/${
                            booth.type === "부스"
                              ? "boothArrow.svg"
                              : "performanceArrow.svg"
                          }`}
                          alt={booth.name}
                        />
                      </>
                    ) : (
                      <>
                        <img
                          id="arrow"
                          type={booth.type}
                          src={`${process.env.PUBLIC_URL}/images/${
                            booth.type === "부스"
                              ? "boothArrow.svg"
                              : "performanceArrow.svg"
                          }`}
                          alt={booth.name}
                        />
                        <p id="time">{booth.time}</p>
                      </>
                    )}
                  </div>
                  <div id="bottom" type={booth.type}>
                    <p id="name">{booth.name}</p>
                    <p id="info">{booth.info}</p>
                  </div>
                </div>
              </TT.Booth>
            ))}
          </TT.Boothlist>
        </TT.Table>
        <TT.SomSom>
          <object
            id="somsom"
            data={`${process.env.PUBLIC_URL}/images/SomSom.svg`}
            alt="somsom"
          />
        </TT.SomSom>
        <TT.TextBox>
          <p id="title">12:00-22:00 상시 운영 부스</p>
          <p id="booth">
            놀러와요 도담이네(~22시)
            <br /> 오늘 밤은 여기 ‘로타’ / 불꽃피움
            <br />
            나란 돌쇠의 마님 환영회 / 화학과 주점
            <br />
            밤하늘을 쏘다 / 국경 없는 바(BAR)
            <br />
            헤어지자고? 링크 주점 이제 시작인데?
          </p>
        </TT.TextBox>
      </TT.Wrap>

      <TT.Footer>
        <object
          data={`${process.env.PUBLIC_URL}/images/Footer.svg`}
          alt="footer"
        />
      </TT.Footer>
    </TT.Container>
  );
};

export default TimeTable;
